import 'Posts.dart';class SearchResponse {  SearchResponse({      this.posts,});  SearchResponse.fromJson(dynamic json) {    posts = json['posts'] != null ? Posts.fromJson(json['posts']) : null;  }  Posts ?posts;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    if (posts != null) {      map['posts'] = posts!.toJson();    }    return map;  }}